INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 2, 1000, "訓練はまだ\nここからですわ", 2, 2, "vo_minigame_1013_icon_1_002_001", "vo_minigame_1013_icon_2_002_001", 1, "調子が上がって\nきたなっ");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 2, 5000, "クスクス、悪くない\n流れですわね", 2, 2, "vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", 2, "ほらほら、\nまだいけるだろ？");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 2, 10000, "すばらしい\n記録ですわ", 3, 2, "vo_minigame_1013_icon_1_004_001", "vo_minigame_1013_icon_2_004_001", 3, "へへっ、おまえら\nやるじゃねえか！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 2, 10000, "乗りに乗って\nいますわね", 3, 3, "vo_minigame_1013_icon_1_005_001", "vo_minigame_1013_icon_2_005_001", 4, "あたしたちはまだ\n止まらねえぜ！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 2, 10000, "まだまだ行きます\nついてきなさい", 3, 3, "vo_minigame_1013_icon_1_005_002", "vo_minigame_1013_icon_2_005_002", 5, "見てろよ！\nマコト班の快進撃だ！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 2, 10000, "エリコ班の\n本領発揮ですわ！", 3, 3, "vo_minigame_1013_icon_1_005_003", "vo_minigame_1013_icon_2_005_003", 6, "うおぉぉっ！\n絶好調だぜ！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 2, 0, "ここからは\n前人未到の領域です！", 3, 4, "vo_minigame_1013_icon_1_006_001", "vo_minigame_1013_icon_2_006_001", 7, "どこまで行けるか\n楽しみだなっ！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (1000, 3, 1, "厄介でしたわ…", 4, 5, "vo_minigame_1013_icon_1_007_001", "vo_minigame_1013_icon_2_007_001", 8, "まだ諦めんなよっ");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (1000, 3, 1, "油断大敵です", 4, 5, "vo_minigame_1013_icon_1_007_002", "vo_minigame_1013_icon_2_007_002", 9, "冷やっとしたぜ…！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (1000, 3, 1, "忌々しいっ…", 4, 5, "vo_minigame_1013_icon_1_007_003", "vo_minigame_1013_icon_2_007_003", 10, "弱音を吐くなっ");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (1500, 4, 99, "大所帯ですわね", 3, 6, "vo_minigame_1013_icon_1_008_001", "vo_minigame_1013_icon_2_008_001", 11, "マコト班集合！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (1500, 4, 99, "エリコ班へようこそ", 3, 6, "vo_minigame_1013_icon_1_008_002", "vo_minigame_1013_icon_2_008_002", 12, "連携してくぞ！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 1, 0, "ナナカちゃんに\nお任せあれ", 6, 8, "vo_minigame_1013_icon_1_020_001", "vo_minigame_1013_icon_2_020_001", 13, "みんなに力を！");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 1, 0, "はっはっは！\n任せろ！", 7, 9, "vo_minigame_1013_icon_1_022_001", "vo_minigame_1013_icon_2_022_001", 14, "任せてくれたまえ");
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3000, 1, 0, "どんどんいくわよ", 8, 10, "vo_minigame_1013_icon_1_023_001", "vo_minigame_1013_icon_2_023_001", 15, "ほな、いきまひょか");
